import React, { useState } from 'react';
import { checkInMember, checkOutMember } from '../../services/attendanceService';

const CheckInOut = () => {
    const [memberId, setMemberId] = useState('');
    const [message, setMessage] = useState('');

    const handleCheckIn = async () => {
        try {
            const response = await checkInMember(memberId);
            setMessage(response.data.message);
        } catch (error) {
            setMessage(error.response.data.message || 'Error checking in');
        }
    };

    const handleCheckOut = async () => {
        try {
            const response = await checkOutMember(memberId);
            setMessage(response.data.message);
        } catch (error) {
            setMessage(error.response.data.message || 'Error checking out');
        }
    };

    return (
        <div className="check-in-out">
            <h2>Check In / Check Out</h2>
            <input
                type="text"
                placeholder="Enter Member ID"
                value={memberId}
                onChange={(e) => setMemberId(e.target.value)}
            />
            <button onClick={handleCheckIn}>Check In</button>
            <button onClick={handleCheckOut}>Check Out</button>
            {message && <p>{message}</p>}
        </div>
    );
};

export default CheckInOut;
